import * as React from 'react';
import { Image, View } from 'react-native';

const Logo = () => {
    return <Image resizeMode={'contain'}
        style={{ width: '100%', height: 50, marginBottom:50 }} source={require('./img/time_manager_icon.png')} />
}

export default Logo
